import ClubesBoard from "../components/ClubesBoard";
import Footer from "../components/Footer";
import React from "react";
import EventsMain from "./events/eventsMain";
const Home=()=>{
    return <div>
        <Slideshow/>
        <ClubesBoard/>
        <iframe width="425" height="350" frameBorder="0" scrolling="no" marginHeight="0" marginWidth="0"
                src="https://www.openstreetmap.org/export/embed.html?bbox=-78.4906303882599%2C-0.2110410925036278%2C-78.48868310451509%2C-0.20939690944432296&amp;layer=mapnik"
                style="border: 1px solid black"></iframe>
        <br/><small><a href="https://www.openstreetmap.org/#map=19/-0.21022/-78.48966">Ver mapa m√°s grande</a></small>
    </div>
}
export default Home
